const SubjectDetails = ({ subject }) => {
    return (
        <div className="subject-details">
            <p>{subject.subName}</p>
            <p>{subject.subCode}</p>
            <p>{subject.sclassName}</p>
            <p>{subject.teacher}</p>
        </div>
    );
};

export default SubjectDetails;
